import React, { Component } from 'react'

export default class Info extends Component {
  
  render() {
    const infodata=[
      {id:1,content:'xxx'},
      {id:2,content:'xxxxxx'},
      {id:3,content:'xxxxxxxxx'},
      {id:4,content:'xxxxxxxxxxxx'},
    ]
      

    
    return (
      <div>
         <ul>
           <li>id:</li>
           <li>title:</li>
           <li>content</li>
         
         </ul>
      </div>
    )
  }
}
